import React from "react";
import "./VendorList.css";

function VendorList({ vendors = [], searchTerm = "", category = "all" }) {
    if (!vendors.length) {
        return <p className="no-results">Loading vendors...</p>;
    }

    // Ensure searchTerm and category are valid before filtering
    const filteredVendors = vendors.filter(vendor =>
        vendor?.name?.toLowerCase().includes(searchTerm.trim().toLowerCase()) &&
        (category === "all" || vendor?.category?.toLowerCase() === category.trim().toLowerCase())
    );

    return (
        <div className="vendor-list">
            <h2>Recommended Vendors</h2>
            <div className="vendor-cards">
                {filteredVendors.length > 0 ? (
                    filteredVendors.map((vendor) => (
                        <div className="vendor-card" key={vendor.id}>
                            {console.log("Displaying Vendor:", vendor)} {/* Debugging */}
                            <h3>{vendor.name || "Unknown Vendor"}</h3>
                            <p>Category: {vendor.category || "Not specified"}</p>
                            <p>Rating: ‚≠ê {vendor.rating ?? "N/A"}</p>
                        </div>
                    ))
                ) : (
                    <p className="no-results">No vendors found matching your search.</p>
                )}
            </div>
        </div>
    );
}

export default VendorList;
